import React from "react"

function TodoItem(props) {
    return (
        <li>
            <div className="round">
                <input 
                    type="checkbox"
                    id="checkbox"
                    checked={props.item.completed}
                    onChange={() => props.handleChange}
                />
            </div>
            <label>
                {props.item}
            </label>
            <span className="todo-delete fas fa-trash-alt"></span>
        </li>
    )
}

export default TodoItem
